g fine arts, history, and philosophy) explore the historical context of creative works and teach you to review source material critically, draw connections between diverse ideas, and evaluate evidence and arguments. Coursework in this field will help you become a better reader, thinker, artist, and writer.","id":"arts-and-humanities"},{"subdomainIds":["leadership-and-management","finance","marketing","entrepreneurship","business-essentials","business-strategy"],"keywords":["small business","international business","business administration","business management","opportunities","sell","finance","economic","global","ethics","investment"],"name":"Business","description":"Business Specializations and courses help you hone skills critical to success in the modern workplace, with areas of study including entrepreneurship, business strategy, marketing, finance, and management. Whether you're a small business owner or working in a large international firm, business courses will improve your ability to analyze, understand, and solve business problems.","id":"business"},{"subdomainIds":["software-development","mobile-and-web-development","algorithms","computer-security-and-networks","design-and-product"],"keywords":["program","engineering","introduction","theoretical","mathematics","projects","computational science","technology","networking","graphics","applications","algorithms","programming"],"name":"Computer Science","description":"Computer science Specializations and courses teach software engineering and design, algorithmic thinking, human-computer interaction, programming languages, and the history of computing. Courses in this broad field will help you think abstractly, approach problems methodically, and develop sound solutions.","id":"computer-science"},{"subdomainIds":["data-analysis","machine-learning","probability-and-statistics"],"keywords":["qualitative data analysis","exploratory data analysis","tools","methods","techniques","software","research","analyst","interpretation"],"name":"Data Science","description":"Data science Specializations and courses teach the fundamentals of interpreting data, performing analyses, and understanding and communicating actionable insights. Topics of study for beginning and advanced learners include qualitative and quantitative data analysis, tools and methods for data manipulation, and machine learning algorithms.","id":"data-science"},{"subdomainIds":["cloud-computing","security","data-management","networking","support-and-operations"],"keywords":["networking","cloud computing","security","data management","operations"],"name":"Information Technology","description":"Information Technology (IT) courses and specializations teach cloud computing, cyber security, data management, networking, and more. Learn to use computers to meet day-to-day business needs and launch or advance your career in the IT industry.","id":"information-technology"},{"subdomainIds":["animal-health","basic-science","health-informatics","healthcare-management","nutrition","patient-care","public-health","research","psychology"],"keywords":["science","cellular","molecular","agriculture","companies","branches","impact factor","bio","biotechnology","zoology","biology","neuroscience","horticulture","biochemistry","plant"],"name":"Health","description":"Health Specializations and courses explore topics related to science, your health, and the health and well being of others. Whether you're interested in science, a trained healthcare professional, or looking to transition into this rapidly growing industry, health courses will improve your ability to understand animal and plant life, use big data to solve key health challenges, manage teams, and conduct evidence-based research.","id":"life-sciences","slug":"health"},{"subdomainIds":["math-and-logic"],"keywords":["problems","logical","mathematical","philosophy","calculator","puzzles","logically","thinking","reasoning","fallacies","computational","symbols","solving","applications","everyday","models"],"name":"Math and Logic","description":"Specializations and courses in math and logic teach sound approaches to solving quantifiable and abstract problems. You'll tackle logic puzzles, develop computational skills, build your ability to represent real-world phenomena abstractly, and strengthen your reasoning capabilities.","id":"math-and-logic"},{"subdomainIds":["personal-development"],"keywords":["plan","goals","skills","coach","tips","self","improvement","personality","professional","goal setting","growth","activities","best","action","leadership"],"name":"Personal Development","description":"Personal development Specializations and courses teach strategies and frameworks for personal growth, goal setting, and self improvement. You'll learn to manage personal finances, deliver effective speeches, make ethical decisions, and think more creatively.","id":"personal-development"},{"subdomainIds":["electrical-engineering","mechanical-engineering","chemistry","environmental-science-and-sustainability","physics-and-astronomy","research-methods"],"keywords":["computer","electrical","civil","mechanical","sciences","physics","mathematics","engineer","chemistry","material","chemical","technology","experiments","astronomy","earth","geoscience"],"name":"Physical Science and Engineering","description":"Physical science and engineering Specializations and courses teach the properties of the world around us, from core concepts in physics and chemistry to applied topics in engineering. Courses in this field will prepare you for a career in electrical, civil, or mechanical engineering, or in research or applied science.","id":"physical-science-and-engineering"},{"subdomainIds":["economics","education","governance-and-society","law"],"keywords":["medicine","economics","humanities","social","studies","behavioral","science","applied","research","methods","disciplines","statistical","history"],"name":"Social Sciences","description":"Social sciences Specializations and courses explore how populations form laws, make decisions, behave in groups, and structure their communities. From education to economics to law, courses in the social sciences will improve your understanding of the dynamics between individuals and groups, and your ability to analyze behaviors and trends.","id":"social-sciences"},{"subdomainIds":["learning-english","other-languages"],"keywords":["lessons","learn","language learning","learn chinese","learn english","english language courses","learn to speak","foreign language","spanish","other languages","grammar","speaking","conversation","writing"],"name":"Language Learning","description":"In language courses and Specializations, you’ll learn to speak, write, and listen effectively in major global languages, including English, Chinese, Spanish, and more. Whether you’re learning a foreign language or improving your communication skills in your native language, coursework in this area will help you understand grammar and syntax conventions, and will prepare you to communicate with confidence in both business interactions and casual conversation.","id":"language-learning"}],"courseId":"flsycYzjEeeTABKJlsHMCA","courseSlug":"blockchain-basics","courseCertificates":["VerifiedCert","Specialization"],"courseTypeMetadata":{"typeName":"standardCourse","definition":{"typeNameIndex":"standardCourse"}},"rawCourseMaterials":{"courseData":{"isReal":true,"certificatePurchaseEnabledAt":1504029436118,"estimatedWorkload":"","description":"This first course of the Blockchain specialization provides a broad overview of the essential concepts of blockchain technology – by initially exploring the Bitcoin protocol followed by the Ethereum protocol – to lay the foundation necessary for developing applications and programming. You will be equipped with the knowledge needed to create nodes on your personal Ethereum blockchain, create accounts, unlock accounts, mine, transact, transfer Ethers, and check balances.       \n\nYou will learn about the decentralized peer-to-peer network, an immutable distributed ledger and the trust model that defines a blockchain. This course enables you to explain basic components of a blockchain (transaction, block, block header, and the chain) its operations (verification, validation, and consensus model) underlying algorithms, and essentials of trust (hard fork and soft fork). Content includes the hashing and cryptography foundations indispensable to blockchain programming, which is the focus of two subsequent specialization courses, Smart Contracts and Decentralized Applications (Dapps). You will work on a virtual machine image, specifically created for this course, to build an Ethereum test chain and operate on the chain. This hands-on activity will help you understand the workings of a blockchain, its transactions, blocks and mining.\n\nMain concepts are delivered through videos, demos and hands-on exercises.","isRestrictedMembership":false,"domainTypes":[{"domainId":"computer-science","subdomainId":"software-development"},{"domainId":"computer-science","subdomainId":"computer-security-and-networks"}],"verificationEnabledAt":1504029436118,"isVerificationEnabled":true,"sessionsEnabledAt":1504029436118,"previewUserIds":[],"id":"flsycYzjEeeTABKJlsHMCA","slug":"blockchain-basics","instructorIds":["5767003"],"subtitleLanguageCodes":["ar","fr","bn","uk","zh-CN","el","it","pt-BR","vi","nl","ko","de","ps","ur","ru","th","id","sv","tr","az","es","fa-AF","hi","ja","kk","hu","pl"],"enrollableSiteUserRoles":[],"promoPhoto":"https:\u002F\u002Fcoursera-course-photos.s3.amazonaws.com\u002Fa8\u002Fd79e8065b111e895dda313fb57c8e8\u002FCourse1_white.jpg","primaryLanguageCodes":["en"],"partnerIds":["458","117"],"categoryIds":[],"isSubtitleTranslationEnabled":true,"name":"Blockchain Basics","courseStatus":"launched","launchedAt":1527529064033,"overridePartnerLogos":{"458":"http:\u002F\u002Fcoursera-university-assets.s3.amazonaws.com\u002F44\u002Fd4d490e30111e6b1e7b1755213ae52\u002F um blockchain. The discussions included the architecture of a decentralized application stack, best practices, emerging standards, and many open issues such as scalability and privacy. Learning concluded with a holistic view of the landscape, including decentralized application use cases and other blockchain platforms.","recommendedBackground":[],"companyLogos":[],"level":"INTERMEDIATE","partnerImages":{"117":"https:\u002F\u002Fd15cw65ipctsrr.cloudfront.net\u002Fd2\u002F634d80d55111e7baac63be124b4485\u002FSUNY.jpg","458":"https:\u002F\u002Fd15cw65ipctsrr.cloudfront.net\u002Fdd\u002Fb9fb70d55111e7b0f415ca7aba6358\u002FBuffalo.jpg"},"learningObjectives":[],"coBrandingEnabled":false,"certificateLogo":"http:\u002F\u002Fcoursera-university-assets.s3.amazonaws.com\u002Fa1\u002F9e8e80d5fb11e781f8b9c372eb5de8\u002FUB_BLU_RGB.png","cmlAdditionalFaqs":[{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EHow long does it take to complete the Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EHow long does it take to complete the Specialization?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ETime to completion can vary based on your schedule, but learners can expect to complete the Specialization in 4 to 6 months. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003ETime to completion can vary based on your schedule, but learners can expect to complete the Specialization in 4 to 6 months. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat background knowledge is necessary?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat background knowledge is necessary?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EKnowledge of at least one modern, high-level programming language is required. Learners should have an understanding of object-oriented design and programming, as well as the command line interface of a Linux-like system. This object-oriented knowledge is necessary for understanding and designing a smart contract. Basic working knowledge of web applications, HTML and javascript are necessary for developing Dapps. Also required is a laptop or a desktop of this specification: 64 bit machine with minimum 4Gb ram, 10Gb free space and Windows 7 or above , or ubuntu 16.04 or Mac os x 10.0+.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EKnowledge of at least one modern, high-level programming language is required. Learners should have an understanding of object-oriented design and programming, as well as the command line interface of a Linux-like system. This object-oriented knowledge is necessary for understanding and designing a smart contract. Basic working knowledge of web applications, HTML and javascript are necessary for developing Dapps. Also required is a laptop or a desktop of this specification: 64 bit machine with minimum 4Gb ram, 10Gb free space and Windows 7 or above , or ubuntu 16.04 or Mac os x 10.0+.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EDo I need to take the courses in a specific order?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EDo I need to take the courses in a specific order?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EIt is important that learners take the courses in order, since the concepts and projects are developed based on the previous course, as described below. \u003C\u002Ftext\u003E\u003Ctext\u003E· The first course focuses on essential concepts and does not require programming.\u003C\u002Ftext\u003E\u003Ctext\u003E· The second course explores the smart contract, gradually building the skills to program smart contracts in Solidity and test them using the Remix IDE. It features a programming project. \u003C\u002Ftext\u003E\u003Ctext\u003E· The third course drills deeper into developing end-to-end applications for the blockchain. It features interaction of a blockchain ecosystem with traditional web applications. Learners will develop applications and a project in the Truffle environment.\u003C\u002Ftext\u003E\u003Ctext\u003E· The fourth course introduces other blockchain platforms and business applications. Learners will compose a white paper that compares industry blockchain platforms.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EIt is important that learners take the courses in order, since the concepts and projects are developed based on the previous course, as described below. \u003C\u002Fp\u003E\u003Cp\u003E· The first course focuses on essential concepts and does not require programming.\u003C\u002Fp\u003E\u003Cp\u003E· The second course explores the smart contract, gradually building the skills to program smart contracts in Solidity and test them using the Remix IDE. It features a programming project. \u003C\u002Fp\u003E\u003Cp\u003E· The third course drills deeper into developing end-to-end applications for the blockchain. It features interaction of a blockchain ecosystem with traditional web applications. Learners will develop applications and a project in the Truffle environment.\u003C\u002Fp\u003E\u003Cp\u003E· The fourth course introduces other blockchain platforms and business applications. Learners will compose a white paper that compares industry blockchain platforms.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWill I earn university credit for completing the Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWill I earn university credit for completing the Specialization?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ENo.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003ENo.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat will I be able to do upon completing the Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat will I be able to do upon completing the Specialization?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EOn completion of this specialization, a learner will recognize foundational concepts of blockchain, and apply these program concepts on the blockchain, including: \u003C\u002Ftext\u003E\u003Ctext\u003E· Algorithms and techniques enabling trust in a decentralized peer-to-peer network\u003C\u002Ftext\u003E\u003Ctext\u003E· Transactions, account, block and the structure of a blockchain\u003C\u002Ftext\u003E\u003Ctext\u003E· The distributed immutable ledger of transactions\u003C\u002Ftext\u003E\u003Ctext\u003E·  Smart contracts, a core idea and computational model of blockchain that enables automation, autonomy, scalability and transparency \u003C\u002Ftext\u003E\u003Ctext\u003E· The blockchain application stack and orchestrating blockchain Dapp solutions for business use cases\u003C\u002Ftext\u003E\u003Ctext\u003E· Ongoing industry-wide blockchain efforts, such as Hyperledger (supply chain)     and R3 Corda (financial)        \u003C\u002Ftext\u003E\u003Ctext\u003E More specifically, on successful completion of the specialization, a learner will able to\u003C\u002Ftext\u003E\u003Ctext\u003E· Have an understanding and working knowledge of the emerging blockchain technology\u003C\u002Ftext\u003E\u003Ctext\u003E· Design and program smart contracts and decentralized application\u003C\u002Ftext\u003E\u003Ctext\u003E· Evaluate the applicability of the blockchain technology to their current business problems\u003C\u002Ftext\u003E\u003Ctext\u003E· Think of innovative application models leveraging the blockchain technology\u003C\u002Ftext\u003E\u003Ctext\u003E· Contribute to protocol improvement of the blockchain\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EOn completion of this specialization, a learner will recognize foundational concepts of blockchain, and apply these program concepts on the blockchain, including: \u003C\u002Fp\u003E\u003Cp\u003E· Algorithms and techniques enabling trust in a decentralized peer-to-peer network\u003C\u002Fp\u003E\u003Cp\u003E· Transactions, account, block and the structure of a blockchain\u003C\u002Fp\u003E\u003Cp\u003E· The distributed immutable ledger of transactions\u003C\u002Fp\u003E\u003Cp\u003E·  Smart contracts, a core idea and computational model of blockchain that enables automation, autonomy, scalability and transparency \u003C\u002Fp\u003E\u003Cp\u003E· The blockchain application stack and orchestrating blockchain Dapp solutions for business use cases\u003C\u002Fp\u003E\u003Cp\u003E· Ongoing industry-wide blockchain efforts, such as Hyperledger (supply chain)     and R3 Corda (financial)        \u003C\u002Fp\u003E\u003Cp\u003E More specifically, on successful completion of the specialization, a learner will able to\u003C\u002Fp\u003E\u003Cp\u003E· Have an understanding and working knowledge of the emerging blockchain technology\u003C\u002Fp\u003E\u003Cp\u00
